        uint256 amount,
        uint stakeDuration
    ) external payable returns (bool success) {
        // Check if the address is not zero
        checkAddressZero(msg.sender);

        // Check if the amount is not zero
        if (amount == 0) {
            revert MyTokenStaking_CannotStakeZero();
